    { name: "Chat App", Image: chatApp, },
    {name: "Clipboard Page", Image: clipboardLanding,},
    { name: "Fylo Webpage", Image: fyloLanding,},
    { name: "Number Game", Image: guessNumber,},
    { name: "Order Summary", Image: orderSummary,},
    { name: "Rock Paper Scissor", Image: rockPaper,},
    { name: "Testimonial Page " , Image: testimonialGrid,},
];
